// src/components/Head.js
import React from "react";
import Helmet from "react-helmet";

const Head = () => (
  <Helmet>
    <title>[Your Name] - Portfolio</title>
    <meta
      name="description"
      content="Portfolio of [Your Name], a creative developer and designer."
    />
    <meta name="keywords" content="portfolio, developer, designer, React, JavaScript" />
    <meta name="author" content="[Your Name]" />
  </Helmet>
);

export default Head;
